import React from 'react';


const List = ({professors, onRouteChange, loadName}) => {
    return(
        <div>
            {
                professors.map((user, i) => {
                    return (
                        <div>
                            <label className="db fw6 lh-copy f2" htmlFor="name">Find your favorite sports</label>
                        </div>
                    );
                })
            }
        </div>
    );
}

export default List;
